import axios from "axios";
import { useEffect, useState } from 'react';

function App() {
  const [message, setMessage] = useState('뭐지');

  const getMessage = async() => {
    const res = await axios.get('/api');
    setMessage({ hello : 'Hello react' })
  }

  useEffect(()=>{
    getMessage();
  }, []);

  return (
    <div className="App">
      {message}
    </div>
  );
}

export default App;
